import React from "react";

const LibrarySongs = ({ songs }) => {
    return (
        <div className="library-songs">
            <img src={songs.cover} />
            <h2>{songs.name}</h2>
            <h3>{songs.artist}</h3>
        </div>
    )
}

export default LibrarySongs;
